/* VCD dumping functions */
MOD_mkBeveren & mkBeveren_backing(tSimStateHdl simHdl)
{
  static MOD_mkBeveren *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkBeveren(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkBeveren::dump_VCD_defs()
{
  (mkBeveren_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkBeveren::dump_VCD(tVCDDumpType dt)
{
  (mkBeveren_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkBeveren_backing(sim_hdl));
}
